import React from "react";
//styles
import styled from "styled-components";

function header() {
    return (
        <Header>
            <Container>
                <h1>Header</h1>
            </Container>
        </Header>
    );
}

const Header = styled.div`
    border: 1px solid red;
`;
const Container = styled.div`
    border: 1px solid red;
`;

export default header;
